import React, { useState, useEffect } from "react";
const url = "https://api.github.com/users/QuincyLarson";

function MultipleReturns() {

  useEffect(() => {
    const res = fetch(url).then(res => console.log(res.json()));
  }, [])

  return (
    <div className="h-screen flex flex-wrap gap-5 justify-center content-center">
      <img src="https://avatars.githubusercontent.com/u/985197?v=4" alt="avatar" className="border-lg radius-lg"/>
    </div>
  )
}

export default MultipleReturns;
